import React from "react";
import logo from "./logo.svg";
import "./App.css";
import Number from "./Number.js";

const App = () => {
  //let numberArr = [9, 8, 7, 6, 5, 4, 3, 2, 1, 0];
  let num;
  let i = 9;
  while (i >= 0) numberArr.push(i--);
  let operationsArr = ["AC", "+/-", "%", "รท", "x", "-", "+", "="];

  return (
    <>
      {numberArr.map(number => (
        <Number key={number} number={number} />
      ))}
    </>
  );
};

export default App;
